INSERT INTO `perfiles` (`id`, `tipo`, `descripcion`, `created_at`, `updated_at`) VALUES
(1, 'Administrador', 'Usuario con la máxima permisología dentro de la aplicación, teniendo el control de la administración de los demás usuarios, así como de todas las configuraciones, funcionalidades y módulos que la aplicación permita.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'Coordinador', 'Tiene todos los permisos de la aplicación, menos los de administración de usuarios y configuración de la aplicación.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 'Investigador Editor', 'Está asignado a los profesores del equipo de investigación del proyecto, podrán agregar registros y realizar modificaciones y eliminaciones de estos (solamente de aquellos registros de los cuales sea autor, es decir creados dentro de la aplicación por él mismo). También podrá aprobar la inclusión de registros enviados por investigadores invitados.', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 'Investigador Invitado', 'Estos usuarios pueden realizar envíos de nuevos registros para ser incluidos en la aplicación, sin embargo, su aprobación queda a consideración del equipo de investigadores del proyecto. No pueden modificar ni eliminar ningún tipo de datos, así como tampoco pueden exportar información o tablas de la base de datos.', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
